  const isstock = ticker.isstock;
  return (
    <div className="ticker-box">
      <div>
        <h3>{ticker.tickername}</h3>
        v
      </div>
      <TickerAPIData
        tickername={ticker.tickername}
        isstock={isstock}
      ></TickerAPIData>

      <h3>{isstock ? "stock" : "crypto"}</h3>
    </div>
  );
};

export default Ticker;
